import React from 'react'
import { Avatar, Card, Button } from 'antd'

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div key="twit"><br />0</div>,
        <div key="followings"><br />0</div>,
        <div key="fd"><br />0</div>
      ]}
    >
      <Card.Meta avatar={<Avatar>zc</Avatar>} />

    </Card>
  )
}

export default UserProfile
